script: |
  super -f text -I q9667.spq | sort > q9667.out

inputs:
  - name: q9667.spq
    data: |
      SELECT col0 / + col0 FROM tab2 (FORMAT parquet) WHERE + col2 NOT IN ( + col1, - ( - - 67 ) + col2 * - 30 * + col2 / + + col2 );
  - name: tab2

outputs:
  - name: q9667.out
    data: |
      1
      1
      1
